import { ref } from 'vue'
import { useUserStore } from '@/stores/user'

export function usePhone() {
  const userStore = useUserStore()
  const state = ref({
    value: '',
    code: '',
    loading: false,
    countdown: 0
  })

  return {
    state,
    userStore
  }
}
